import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/Login.css';

const Login = () => {
  const [email, setEmail] = useState('admin@test.com'); // Temporary default for testing
  const [password, setPassword] = useState('password'); // Temporary default for testing
  const [error, setError] = useState('');
  const navigate = useNavigate(); // Now properly used below

  // Try adding these console logs to debug
const handleSubmit = async (e) => {
  e.preventDefault();
  setError('');
  
  console.log('Attempting to log in with:', email, password);
  
  try {
    console.log('Sending request to:', 'http://localhost/real_estate_project/api/login.php');
    const response = await fetch(
      'http://localhost/real_estate_project/api/login.php',
      {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ email, password }),
        credentials: 'include'
      }
    );

    console.log('Response status:', response.status);
    const data = await response.json();
    console.log('Login response:', data);

    // Rest of your code...
  } catch (err) {
    console.error('Login error details:', err);
    setError('Connection error. Please try again.');
  }
};

  return (
    <div className="login-page">
      <h1>Login</h1>
      {error && <div className="error-message">{error}</div>}
      
      <form onSubmit={handleSubmit} className="login-form">
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <button type="submit">Login</button>
      </form>
    </div>
  );
};

export default Login;
